@@ -38,9 +38,21 @@ public class TikaUntar {

             TarArchiveEntry tae = tais.getNextEntry();

+            // Get the canonical path of the extract directory for security checks
+            Path canonicalExtractDir = extractDir.toAbsolutePath().toRealPath();
+
             while (tae != null) {
                 if (tae.isFile()) {
-                    Path target = extractDir.resolve(tae.getName()).normalize();
+                    String entryName = tae.getName();
+                    // Reject entries with path traversal sequences before resolving
+                    if (entryName.contains("..") || entryName.startsWith("/") || entryName.startsWith("\\")) {
+                        throw new IOException("Invalid tar entry name: " + entryName);
+                    }
+                    Path target = canonicalExtractDir.resolve(entryName).normalize();
+                    // Second check: ensure the normalized target is still within extract dir
+                    if (!target.startsWith(canonicalExtractDir)) {
+                        throw new IOException("Path traversal detected in tar entry: " + entryName);
+                    }
                     if (!Files.isDirectory(target.getParent())) {
                         Files.createDirectories(target.getParent());
                     }
